import React from 'react'

const RenderCondicional = () => {
    const renderAlgo = (x) => {
        if(x) {
            return <p>X verdadeiro</p>;
        }
        else {
            return <p>X falso</p>;
        }
    }
    return (
        <div>
            {renderAlgo(true)}
        </div>
    )
}

export default RenderCondicional
